import React from 'react';

const TreeNode = ({ node }) => (
  <ul>
    <li>
      {node.name}
      {node.children && node.children.length > 0 && (
        <ul>
          {node.children.map(childNode => (
            <TreeNode key={childNode.id} node={childNode} />
          ))}
        </ul>
      )}
    </li>
  </ul>
);

const Tree = ({ data }) => (
  <div>
    {data.map(node => (
      <TreeNode key={node.id} node={node} />
    ))}
  </div>
);

export default Tree;
